import Welcome from "./Wellcome";
import Test from "./Test";

export default [
  {
    path: "/",
    name: "Home",
    component: <Welcome />,
  },
  {
    path: "/students",
    name: "Students",
    component: <Test t="Students" />,
  },
  {
    path: "/professors",
    name: "Professors",
    component: <Test t="Professors" />,
  },
  {
    path: "/courses",
    name: "Courses",
    component: <Test t="Courses" />,
  },
  {
    path: "/exams",
    name: "Exams",
    component: <Test t="Exams" />,
  },
];
